const LZ = require('lz-string');

const data = ``;
console.log('Data length:', data.length);
console.log('Prefix:', data.slice(0, 40));

let json = LZ.decompressFromBase64(data);
if (!json) {
  json = LZ.decompressFromEncodedURIComponent(data);
}

if (!json) {
  console.error('Failed to decompress data');
  process.exit(1);
}

console.log('Length:', json.length);
const parsed = JSON.parse(json);
console.log('Top-level keys:', Object.keys(parsed));
console.log('Tick:', parsed.metadata?.time);
console.log('Rooms:', Object.keys(parsed.rooms || {}));
console.log('Creeps keys:', Object.keys(parsed.creeps?.memory || {}).slice(0, 10));
